script: |
  super -f text -I q6461.spq | sort > q6461.out

inputs:
  - name: q6461.spq
    data: |
      SELECT + - col0 / - + col2 * - col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN NULL AND - col2 * - ( + col1 ) + + col0 + col2;
  - name: tab0

outputs:
  - name: q6461.out
    data: |
